import "./main.scss"
import Header from "./components/Header";
import Opening from "./components/Opening";
import Carousel from "./components/Carousel";
import React from "react";

function App() {
  return (
    <div className="App">
        <Header/>
        <Opening/>
        <Carousel>
            <img src="https://via.placeholder.com/1600x300" alt="placeholder" />
            <button>123</button>
            <img src="https://via.placeholder.com/1600x300" alt="placeholder" />
            <img src="https://via.placeholder.com/1600x300" alt="placeholder" />
        </Carousel>
    </div>
  );
}

export default App;
